import React, {useState} from 'react';
import axios from 'axios';
const url = 'http://localhost:5000/forum'

class ForumPosts extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            posts_list: []
        };
    }

    componentDidMount() {
        fetch(url)
        .then(response => response.json())
        .then(data => this.setState({ posts_list : data}));

    }

    redner() {
       return(
           <div>
               {this.state.posts_list && this.state.posts_list.map(p => {
                   const title = p.title;
                   const publisher = p.publisher;
                   const content = p.content;
                   const cost = p.Cost;

               return (
                   <div>
                       <h1>{title}</h1>
                       <p>{publisher}</p>
                       <p>{content}</p>
                       <p>{cost}</p>
                   </div>
               )
            })}
            </div>
       );
    }
}

export default ForumPosts;
